import React, { useEffect, useState } from "react";
import PropTypes from "prop-types";

function CommitList({ repoName }) {
  const [commits, setCommits] = useState([]);

  useEffect(() => {
    fetch(`https://api.github.com/repos/Netflix/${repoName}/commits`)
      .then((response) => response.json())
      .then((data) => {
        const commitsData = data.map((commit) => commit.commit);
        setCommits(commitsData);
      })
      .catch((error) => console.log(error));
  }, [repoName]);

  return (
    <div>
      {commits.length > 0 ? (
        <ol>
          {commits.map((commit, index) => (
            <li key={index}>
              <p>
                <b>Commit message:</b> {commit.message}
              </p>
              <p>
                <b>Committer username</b>: {commit.committer.name}
              </p>
              <p>
                <b>Commit hash:</b> {commit.tree.sha}
              </p>
              <p>Date created: {commit.committer.date}</p>
            </li>
          ))}
        </ol>
      ) : (
        <p>No commits found.</p>
      )}
    </div>
  );
}

CommitList.propTypes = {
  repoName: PropTypes.string,
};

export default CommitList;
